import React from 'react';

const Index = () => {
    return (
        <div className="flex flex-wrap items-center justify-center py-10">
            <div className="flex flex-col items-center align-middle py-4 px-4">
                <img src="/img/pfp.png" className="rounded-full shadow-md"></img>
                <h1 className="px-4 text-4xl text-white leading-normal">Hello there, my name is <span className="text-indigo-200 font-bold">Kyu</span></h1>
                <p className="py-4 px-4 text-lg text-white leading-none font-semibold">I'm a high-school student, full-stack developer and an aspiring entrepreneur.</p>
                <div className="flex flex-row items-center justify-center">
                    <ul>
                        <li><a className="rounded-lg bg-indigo-500 py-2 px-4">hi</a></li>
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Index;
